INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'lock_escalation', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当细粒度锁转换为粗粒度锁时发生，例如将行锁转换为对象锁时。使用此事件来监视如何在服务器上使用锁。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'lock_timeout_greater_than_0', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在因其他资源正持有阻塞锁而使锁请求超时时发生。此事件等同于 lock_timeout，但不包括超时值为 0 的情况(例如在使用锁探测时)。持续时间为 0 的超时值不一定表示阻塞问题。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'bitmap_disabled_warning', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在查询使用位图筛选器而该位图筛选器已被禁用的情况下发生。使用此事件来解决具有位图筛选器的查询的性能问题，并标识因不可选而被禁用的位图筛选器对应的那些查询。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'dtc_transaction', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当通过 Microsoft 分布式事务处理协调器协调 SQL Server 事务时发生。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'marked_transaction_latch_trace', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'调试标记的事务闩锁相关的诊断信息', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'global_transaction_message', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'全局事务开始时发生。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'global_transaction_complete', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在提交或中止全局事务时记录', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'global_transaction_snapshot', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'全局事务完成时发生。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'degree_of_parallelism', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'每次在 SQL Server 执行 SELECT、INSERT、UPDATE 或 DELETE 语句时发生。使用此事件来监视查询是否在并行运行。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'sql_transaction', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当 SQL Server 事务开始、完成、回滚或执行保存点操作时发生。在解决应用程序、触发器或存储过程的问题时可使用此事件监视事务行为。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'scan_started', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当表或索引扫描开始时发生。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'scan_stopped', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在表或索引扫描停止时发生。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'transaction_log', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在向 SQL Server 事务日志添加记录时发生。这是一个将会影响服务器性能的海量事件。因此，应使用适当的筛选功能来减少事件数目，并仅应将此事件用于短期的有针对性的故障排除。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'hash_warning', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当内存不足以处理哈希联接的生成输入时发生。这将导致哈希递归(对生成输入进行分区时)或哈希释放(对生成输入的分区超过最大递归级别时)。将此事件与任意的 query_pre_execution_showplan 或 query_post_execution_showplan 事件一起使用，用来确定生成的计划中的哪一操作导致了该哈希警告。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'hash_spill_details', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'如果处理哈希联接的生成输入时内存不足，哈希处理结束时会发生。结合使用此事件与任何 query_pre_execution_showplan 或 query_post_execution_showplan 事件来确定生成计划中的哪个操作导致了哈希溢出。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'execution_warning', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当 T-SQL 语句或存储过程等待内存授予的时间超过一秒或是在最初尝试获取内存失败时发生。将此事件与标识等待的事件配合使用来解决影响性能的争用问题', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'sort_warning', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当针对正在执行的查询的排序操作不符合内存要求时发生。仅为查询中的排序操作(而不会为由索引创建引起的排序操作)生成此事件。(例如，将为 Select 语句中的 Order By 生成此事件。)使用此事件来标识由于排序操作而执行较慢的查询，特别是在 warning_type = 2 (指示排序需要多次通过数据)的情况下', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'batch_hash_table_build_bailout', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当生成哈希表的批处理操作遇到内存不足情况并切换到行模式操作时发生。使用此事件来标识由于内存不足情况导致的性能问题。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grant_info_sampling', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在提供内存授予信息的随机样本查询结束时发生。(例如，可用于遥测)', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'additional_memory_grant', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当查询在执行期间尝试获取更多内存授予时发生。如果无法获取此额外的内存授予，可能导致查询变慢。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'server_memory_change', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当服务器内存使用量的增幅或降幅超过 1 兆字节(MB)或最大服务器内存的 5% (取两者的较大值)时发生。使用此事件来标识服务器上内存使用量的增长时段。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'database_file_size_change', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当数据库的任何数据或日志文件更改大小时发生。使用此事件来监视数据库文件大小的更改。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'exchange_spill', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当具有多个并行运算符的查询的内存通信缓冲区变满从而导致运算符之一写入 TempDB 时发生。如果在单个查询计划中多次出现此情况，查询性能将受到影响。将此事件与任何 *_showplan 事件一起使用，通过 node_id 字段来确定生成的计划中的哪个操作引起交换溢出', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'blocked_process_report', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当任务被阻塞的时间超过 sp_configure 阻塞的进程阈值设置所指定的时间时发生。此事件不是由系统任务或正在等待未发现死锁的资源的任务触发的。使用此事件来解决阻塞的进程问题。(默认情况下不生成阻塞的进程报告。)', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'blocked_process_report_filtered', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当任务被阻塞的时间超过 sp_configure 阻塞的进程阈值设置所指定的时间时发生。此事件不是由系统任务或正在等待未发现死锁的资源的任务触发的。使用此事件来解决阻塞的进程问题。筛选出敏感信息。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'database_mirroring_state_change', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当数据库镜像的状态已更改时发生。使用此事件来监视数据库镜像的状况。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'progress_report_online_index_operation', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在联机索引生成过程中发生，用来指示生成操作的进度。联机索引生成操作的每个阶段都生成一个事件。使用此事件来监视联机索引生成。', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_trace_column_values', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'跟踪各个查询计划运算符上各个行的输出列值', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grant_blocking', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当查询在等待内存授予时阻塞了其他查询时发生', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grant_usage', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在内存授予超过5MB的查询处理结束时发生，让用户知道内存授予的不准确之处', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grant_wait_begin', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当查询进入内存授予的等待队列时发生', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grant_wait_end', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当查询正在退出内存授予的等待队列时发生', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grant_resource_semaphores', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'对于每个 Resource Governor 资源池，每隔 5 分钟发生一次', 2, N'sds_visible', N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'query_memory_grants', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'对于具有内存授予的每个查询，每隔 5 分钟发生一次', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'database_suspect_data_page', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'在向 msdb 数据库中的 suspect_pages 表添加页时发生。在向 suspect_pages 表插入相应页时异步引发此事件。因此，侦听此事件的作业可能无法立即发现相关的 suspect_pages 条目。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'cpu_threshold_exceeded', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'当 Resource Governor 检测到查询超过为 REQUEST_MAX_CPU_TIME_SEC 指定的 CPU 阈值时发生。检测间隔为五秒。此事件可确保检测到超过阈值至少五秒的查询。如果查询超过阈值不足五秒，则可能错过此检测，具体取决于查询的时间和上次检测扫描的时间。', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
