INSERT INTO sys.dm_xe_objects (name, object_type, package_guid, description, capabilities, capabilities_desc, type_name, type_package_guid, type_size) VALUES (N'remove_database_cache', N'event', N'03FDA7D0-91BA-45F8-9875-8B6DD0B8E9F2', N'删除数据库缓存', null, null, N'null', N'60AA9FBF-673B-4553-B7ED-71DCA7F5E972', 0);
